import React from 'react'
import { NavLink } from 'react-router-dom'
import logo from '../images/logo.jpeg'
import MenuIcon from '@material-ui/icons/Menu';
import Timer from './Timer';


const Navbar = ({toggle}) => {
    const MinSecs = { minutes: 10, seconds: 0 }
    return (
        <>
            <nav className="flex menu justify-between items-center h-16 bg-white text-black relative shadow-sm m">
                {/* logo */}
                <div className="flex items-center">
                    <NavLink to="/"><img className="h-full logo" src={logo} alt="CODINGAL" /></NavLink>
                    <NavLink to="/" className="pl-4">Trial lesson[Grade 1-3]</NavLink>
                </div>

                {/* hamburger button */}
                <div className="px-4 w-8 h-16  cursor-pointer md:hidden" onClick={toggle}>
                    <MenuIcon />
                </div>

                {/* manubar */}
                <div className=" timerbtn pr-8 md:block hidden">
                <div className=" md:block hidden">
                <Timer className="p-4" MinSecs={MinSecs} />
                </div>
                    <button className="bg-red-500 ml-4 md:block hidden  hover:bg-red-700 text-white font-bold py-2 px-4 rounded">End Class</button>
                </div>
            </nav>

        </>
    )
}

export default Navbar
